import CrearRequisicionForm from './components/CrearRequisicionForm';
import './App.css';

function App() {
  return (
    <div className="App">
      <div>
        <h1>Laboratorio - Requisiciones</h1>
        <CrearRequisicionForm />
      </div>
    </div>
  );
}

export default App;
